angular.module("MyApp").controller("AddCtrl",function(n,e,t,o,a,i){n.jobs={},n.search=function(){a.jsonp("http://api.adzuna.com:80/v1/api/jobs/au/search/1?app_id=4d5ed715&app_key=9e0bb8521ad6e3c5e82276ffba08d48a&callback=JSON_CALLBACK&results_per_page=100&what="+encodeURIComponent(n.keyword)+"&content-type=application/jsonp").then(function(e){n.jobs=e.data.results})},n.viewJob=function(e){n.currentJob=i.trustAsResourceUrl(e.redirect_url),n.job=e,console.log(e)},n.getProfile=function(){o.getProfile().success(function(e){n.user=e}).error(function(n){t({content:n.message,animation:"fadeZoomFadeDown",type:"material",duration:3})})},n.updateProfile=function(){o.updateProfile({displayName:n.user.displayName,email:n.user.email}).then(function(){t({content:"Profile has been updated",animation:"fadeZoomFadeDown",type:"material",duration:3})})},n.link=function(o){e.link(o).then(function(){t({content:"You have successfully linked "+o+" account",animation:"fadeZoomFadeDown",type:"material",duration:3})}).then(function(){n.getProfile()}).catch(function(n){t({content:n.data.message,animation:"fadeZoomFadeDown",type:"material",duration:3})})},n.unlink=function(o){e.unlink(o).then(function(){t({content:"You have successfully unlinked "+o+" account",animation:"fadeZoomFadeDown",type:"material",duration:3})}).then(function(){n.getProfile()}).catch(function(n){t({content:n.data?n.data.message:"Could not unlink "+o+" account",animation:"fadeZoomFadeDown",type:"material",duration:3})})},n.getProfile()});